        return (
    <form className="container">
        <div className='row'>
        <label for="exampleTextarea" className="form-label mt-4">Ecrivez votre message et cliquez sur postez pour qu'il se rajoute aux posts du forum</label>
            <div className="form-group col-8">
                <textarea className="form-control" id="exampleTextarea" rows="3"></textarea>
            </div>
